import React from "react";
import "./Area.css";

class Area extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      areas: [
        { id: 0, area: "서울" },
        { id: 1, area: "경기" },
        { id: 2, area: "인천" },
        { id: 3, area: "강원" },
      ],
      isslected: false,
    };
  }

  render() {
    var data = this.state.areas;
    var i = 0;
    var list = [];
    while (i < data.length) {
      list.push(
        <li key={data.id} className="areaList">
          <a
            className="listA"
            href={"/" + data[i].id}
            onclick={function (id, e) {
              e.preventDefault();
              this.props.onSlected(id);
            }.bind(this)}
          >
            {data[i].area}
          </a>
        </li>
      );
      i = i + 1;
    }
    return (
      <div>
        <ul>{list}</ul>
      </div>
    );
  }
}

export default Area;
